import './App.css';
import Main from './component/Main';
import Login from './component/Login';
import Game from './component/Game'
import {
  BrowserRouter,
  Routes,
  Route,
  HashRouter,
} from "react-router-dom";
function App() {
  return (
    <HashRouter>
        <Route path="/" component={ Game} />
        <Route path="/" component={Main} />
        <Route path="login" component={<Login />} />
    </HashRouter>
)}

export default App;
